import React from 'react';
import { Provider } from 'react-redux';
import { store } from './store';
import Topic from './components/Topic';
import Toolbar from './components/Toolbar';
import { MindMap } from './types/MindMap';

// 示例数据
const sampleMindMap: MindMap = {
  id: '1',
  rootTopic: {
    id: '1',
    title: '项目计划',
    isCompleted: false,
    children: [
      {
        id: '2',
        title: '需求分析',
        isCompleted: false,
        children: []
      },
      {
        id: '3',
        title: '设计阶段',
        isCompleted: false,
        children: []
      },
      {
        id: '4',
        title: '开发阶段',
        isCompleted: false,
        children: []
      }
    ]
  },
  createdAt: new Date(),
  updatedAt: new Date(),
  settings: {
    completedColor: '#4CAF50',
    incompletedColor: '#FF5252',
    showNotifications: true,
    autoLayout: true
  }
};

function App() {
  return (
    <Provider store={store}>
      <div className="App">
        <h1>思维导图任务跟踪</h1>
        <Toolbar />
        <Topic topic={sampleMindMap.rootTopic} />
      </div>
    </Provider>
  );
}

export default App;
